- input: "TEXT\x1CC00003988\x1CTEXT-00001\x1C\x1CF3XA\x1CThis report is being amended
    in response to the Commission's Request, dated March 18, 2009.      1.  The Committee
    Correctly reported the transfer from the North Dakota Democratic Party correctly.
    \ The Committee believes that the NDDP failed to report the transfer on thier
    report.    2.  The Committee agrees with the Commission and notes that the contribution
    from NELPAC was excessive. The excess will be refunded in the current period and
    will be reported on the May Monthly Report.    3.  The Committee has updated information
    on contributors.    4.  The Committee has updated missing addresses and purposes.
    \   5.  The transfers in from National Party Committees were placed in a segregate
    account and those funds were not used for levin or exempt activities.    6.  Schedule
    L has been updated.     7.  Candidate and election information has been updated
